Patch Set 4:

@alex, based on current implement, if the image is updated with no location, then the image status will be updated as 'queued'. FYI.

And for image, seems there is no good way to do the version control.

Patch Set 9: (2 inline comments)

@zhiyan, I have addressed all your comments. Thanks for that.

@iccha, it's a good question. After go though the code, I think the status transition from 'active' to 'queued' is only supported in v2 because we can update location filed for an image which not in queued status. See https://github.com/openstack/glance/blob/master/glance/api/v1/images.py#L808

Thanks again for your reviewing, guys.
